import React from 'react';
import {Control, LocalForm, Errors} from 'react-redux-form';

class Queries extends React.Component {
    constructor(props){
        super(props);
      
    }
   
    render(){
        return(
            <>
                <LocalForm onSubmit={(values) => this.handleSubmit(values)}>

                </LocalForm>
            </>
        );
    }
}

export default Queries;
